export function Login ({user,setUser}) {

    const handleChange = (e) => {
        setUser(e.target.value)
        console.log(user)
    }

    return (
    <div className="bg-slate-500 h-screen flex items-center justify-center">
        <div className="border rounded border-white w-1/4 h-2/4 bg-slate-400">
            <div className="text-center"> 
            <h1 className="mt-12 mb-12 text-5xl">Login</h1>
            <form className="flex flex-col items-center">
                <label className="mb-12">Username</label>
                <input onChange={handleChange} value={user} className="rounded pl-1 w-1/4" placeholder="Enter username" type="text" />
            </form>
            
            </div>
        </div>
    </div>
    )
}
